const fs = require("fs");
const path = require("path");
const puppeteer = require('puppeteer');
const handlebars = require("handlebars");
const logo = '<img src="data:image/png;base64," style="height: 60px;width: 200px;" />';

async function createPDF() {
	// Load JSON data from external file
	const data = JSON.parse(fs.readFileSync(path.join(process.cwd(), 'data.json'), 'utf8'));

	// Read and compile the Handlebars template
	const templateHtml = fs.readFileSync(path.join(process.cwd(), 'template.html'), 'utf8');
	const template = handlebars.compile(templateHtml);
	const html = template(data);

	// Set the output PDF filename with a timestamp
	const milis = new Date().getTime();
	const pdfPath = path.join('pdf', `${data.customer.name}-${milis}.pdf`);

	// Puppeteer PDF options for portrait mode and header
	const options = {
		format: 'A4',                 // Use A4 paper size
		landscape: false,             // Ensure portrait mode
		displayHeaderFooter: true,    // Enable header and footer
		headerTemplate: `
		<div style="font-size:10px; width: 100%; padding: 10px 20px; box-sizing: border-box; display: flex; justify-content: space-between; align-items: center; background-color: red; height: 60px;color:rgb(29 17 81)">  
		  ${logo}
		  <span style="font-size: 16px; font-weight: bold;">Customer Fashion Report</span>
		</div>`,
		footerTemplate: `
		<div style="font-size:12px; width: 100%; padding: 10px 20px; box-sizing: border-box; display: flex; justify-content: space-between; align-items: center; background-color: red; height: 50px;color:rgb(29 17 81)">  
		  <span style="font-size: 12px; font-weight: bold;">Powered by Fashion Store</span>
		  <span style="font-size: 12px;">Page <span class="pageNumber"></span> of <span class="totalPages"></span></span>
		</div>`,
		margin: {
			top: "150px",              // Set enough margin to fit the header
			bottom: "150px",           // Set enough margin to fit the footer
			left: "20px",             // Optional: left margin
			right: "20px"             // Optional: right margin
		},
		printBackground: true,        // Print CSS background colors
		path: pdfPath                 // Save PDF to this path
	};

	// Launch Puppeteer and generate the PDF
	const browser = await puppeteer.launch({
		args: ['--no-sandbox'],
		headless: true
	});

	const page = await browser.newPage();

	// Load the HTML content generated by Handlebars
	await page.setContent(html, {
		waitUntil: 'networkidle0'
	});

	// Add CSS to prevent overlap
	await page.addStyleTag({
		content: `
		body {
		  margin: 0; 
		  padding: 0;
		  box-sizing: border-box;
		}
		.content {
		  margin-top: 60px;  /* Ensure content does not overlap the header */
		  margin-bottom: 40px; /* Ensure content does not overlap the footer */
		}
	  `
	});

	// Create PDF in portrait mode
	await page.pdf(options);
	await browser.close();

	console.log(`PDF created in portrait mode: ${pdfPath}`);
}

// Call the function to generate the PDF
createPDF();